import "./SetProfile.css";
import tImg from "../img/logo192.png";

const SetProfile = () => {
    return (
        <div className="SetProfile">
            <div>1. 프로필 사진</div>
            <div><img src={tImg}/></div>
            <div>2. 닉네임</div>
            <div>
                <textarea 
                    value={state.email} 
                    onChange={handleOnChangeEmail} 
                    placeholder="이메일 입력" />
            </div>
                
        </div>
    );
}

export default SetProfile;
